import React from "react";
import Digital from "./../img/Digital.png";
import FacebookIcon from '@material-ui/icons/Facebook';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import InstagramIcon from '@material-ui/icons/Instagram';
import './../css/Header.css';

function Header() {
    return (
        <div className="head">
            <div className="top">
                <div className="left">
                    <p>Company Email will be here</p>
                </div>
                <div className="logo" >
                    <img src={Digital} alt="Digital" style={{ width: "300px", height: "120px" }} />
                </div>
                <div className="social" style={{fontSize:"100"}}>
                    <a href="#"><LinkedInIcon style={{color: "blue[500]"}} className="icon"/></a>
                    <a href="#"><FacebookIcon  className="icon"/></a>
                    <a href="#"><InstagramIcon className="icon" /></a>
                </div>
            </div>
            <div className="navbar">
                <a href="#">Home</a>
                <a href="#">Our Services</a>
                <a href="#">Our Team</a>
                <a href="#">Testimonials</a>
                <a href="#">Contact Us</a>
            </div>
        </div>
    )
}

export default Header;
